var MarkupInvoice = {
    ImageData: 'data:image/png;base64,',
    ElementWidthMm: 190,

    HandlesType: function(type) {
        return type == 'invoice';
    },

    Paint: function(elementObject) {
        $('#' + elementObject.Handle)
            .html('<img>')
            .css({
                left: SizeCalculator.ToPixels(elementObject.x) + 'px',
                top: SizeCalculator.ToPixels(elementObject.y) + 'px',
                width: SizeCalculator.ToPixels(this.ElementWidthMm) + 'px'
            });

        $('#' + elementObject.Handle).children('img')
            .attr('src', this.ImageData)
            .css('width', '100%');
    },

    Activate: function(elementObject) {
        
    },

    Update: function(elementObject) {
        this.Paint(elementObject);
    },

    New: function(markup, text) {
       markup.AddElement({
           type: "invoice",
           x: 10,
           y: 150,
           properties: {
               x: {
                   label: 'Left (mm)',
                   component: 'number'
               },
               y: {
                   label: 'Top (mm)',
                   component: 'number'
               }
           }
       });
    }
};
